import React from "react";

function Header(){
    return(
        <div id="main">
            <div className="header-heading">
                <h2>SET UP YOUR</h2>
                <h1><span>BUSINESS</span> WITH US </h1>
                <p className="details">Build Your Marketing Business With Professional
                Touch</p>
                <div className="header-btns">
                    <a href="#" className='header-btn'>JOIN US</a>
                </div>
            </div>

        </div>
    )
}
export default Header;
